// App.js

import React, { Component } from "react";
import { NavigationContainer } from "@react-navigation/native";
import { createStackNavigator } from "@react-navigation/stack";
import { Button, View, Text } from "react-native";

import Home from "./screens/Home";
import Fitnessplan from "./screens/Fitnessplan";
import Fitnessinfo from "./screens/Fitnessinfo";
import Login from "./screens/Login";
import EditCourse from "./screens/admin/EditCourse";
import AddCourse from "./screens/admin/AddCourse";

import credentials from "./screens/data/credentials.json";

const Stack = createStackNavigator();

//Login und Fitnessinfo funktioniert bislang nur auf dem Desktop (nicht mobile)
function NavStack(navigation) {
  return (
    <Stack.Navigator
      screenOptions={{
        headerTitleAlign: "center",
        headerStyle: {
          backgroundColor: "#621FF7",
        },
        headerTintColor: "#fff",
        headerTitleStyle: {
          fontWeight: "bold",
        },
      }}
    >
      <Stack.Screen
        name="Home"
        component={Home}
        options={{
          title: "Home",
        }}
      />
      <Stack.Screen
        name="Fitnessplan"
        component={Fitnessplan}
        options={{ title: "Fitnessplan" }}
      />
      <Stack.Screen
        name="Fitnessinfo"
        component={Fitnessinfo}
        options={{ title: "Fitnessinfo" }}
      />
      <Stack.Screen
        name="Login"
        component={Login}
        options={{ title: "Login" }}
      />
      <Stack.Screen
        name="AddCourse"
        component={AddCourse}
        options={{ title: "AddCourse" }}
      />
      <Stack.Screen
        name="EditCourse"
        component={EditCourse}
        options={{ title: "EditCourse" }}
      />
    </Stack.Navigator>
  );
}

export default class App extends Component {
  constructor(props) {
    super(props);

    this.state = {
      credentials: credentials,
      isLoggedIn: Boolean,
      username: "",
      password: "",
    };
  }
  render() {
    return (
      <NavigationContainer>
        <NavStack />
      </NavigationContainer>
    );
  }
}
